// ==UserScript==
// @name         IMDB List - Trakt.tv Button
// @version      1.2
// @description  Adds a button linking to Trakt.tv and Letterboxd page to any IMDB Charts
// @author       SecretUnicorn & LenAnderson
// @match        https://www.imdb.com/chart/*
// @namespace    https://github.com/SecretUnicorn/
// @downloadURL  https://github.com/SecretUnicorn/IMDB-List-Trakt.tv-Button/raw/master/imdb_list_trakttv_button.user.js
// @grant        none
// ==/UserScript==

(function() {
    'use strict';
		const list = document.getElementsByClassName("ipc-metadata-list").item(0);
  	const regex = /\/title\/(tt\d+)\//;
  	Array.from(list.children).forEach(li => {
    	const link = li.getElementsByTagName("a").item(0)
      const match = link.href.match(regex);
      if (match && match[1]) {
        const id = match[1];
        const lastDiv = li.getElementsByClassName("cli-post-element").item(0);
        lastDiv.style = "align-items: center";
        let a = document.createElement('a'); {
        a.href = `https://trakt.tv/search/imdb/${id}`;
      	a.target = "_blank"
      	a.referrer = "noref"
        a.style.display = 'inline-block';
        a.style.height = '32px';
        a.style.width = '32px';
        a.style.backgroundImage = `url("data:image/png;base64,")`;
        a.title = 'Trakt.tv';
        lastDiv.appendChild(a);
        let a2 = document.createElement('a');
        a2.href = `https://letterboxd.com/imdb/${id}`;
        a2.style.display = 'inline-block';
        a2.style.height = '32px';
        a2.style.width = '32px';
        a2.style.backgroundImage = `url("data:image/png;base64,")`;
        a2.title = 'Letterboxd';
        a2.style.backgroundSize = 'contain';
        a2.style.marginLeft = '5px';
        a2.target = "_blank";
        a2.ref = "noopener";
        lastDiv.appendChild(a2);

    }
      }
    })

})();
